import React from "react";
import Card from "../Components/Card";
import Wdata from "../Components/WatchData";

function wcard(val) {
  return <Card imgsrc={val.imgsrc} title={val.title} price={val.price} />;
}

const Products = () => {
  return (
    <>
      <div className="container">
        <div className="row my-4 py-5">
          <div className="col-md-6">
            <h6>SORT BY</h6>
          </div>
          <div className="col-md-6">
            
          </div>
        </div>
      </div>
      <div className="container">
        <div className="row">{Wdata.map(wcard)}</div>
      </div>
    </>
  );
};

export default Products;
